import { Fragment } from "react";
import { useParams, Route } from "react-router-dom";

const QuoteDetail = () => {
  const params = useParams();
  return (
    <Fragment>
      <h1>Quote Detail Page!</h1>
      <h2>{params.quoteId}</h2>
      <Route path={`/quotes/${params.quoteId}/`}></Route>
    </Fragment>
  );
};

export default QuoteDetail;
